            </div>  )
    }
    return(
        <div className="contact">
            {contactSM}
            <iframe key="2" className="cForm" src="https://docs.google.com/forms/d/e/1FAIpQLSe8s_6jTQDRsp33lByT5SqsaJERrUX6mg6dzWC-HtKhbpmaQQ/viewform?embedded=true" frameborder="0" marginheight="0" marginwidth="0">Loadingâ€¦</iframe>

        </div>
    );
};

export default about;
